import React from 'react';
import './List.css';
import Title from '../../components/title/Title';
import Doctor from '../../components/doctor/Doctor';

const List = () => {
  return (
    <div className='list p-4'>
      <Title title='all doctors'/>
      <div className='doctors-list'>
        <Doctor />
      </div>
    </div>
  )
}

export default List
